import './App.css';
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import { routes } from './route';
import LogIn from "./Component/pageJoin/LogIn";
import ChatPage from "./Component/pageChat/PageChat";
// import CommonLayout from "./Component/CommonLayout";

function App() {

  const displayPages = (listPage) => {
    return listPage.map((page,index) => {
      return <CommonLayout 
      key={ page.name}
      component = { page.component}
      exact = {page.exact}
      path={page.path}
      />
    }) 
  }

  return (
    <Router>
      <Switch>
      {displayPages(routes)}
      <Route exact={true} path="/" component={LogIn}/>
      <Route exact={true} path="/chatpage" component={ChatPage}/>
      </Switch>
    </Router>
  );
}

export default App;
